<p>当 JavaScript 引擎执行每一条语句时，都会生成一个Completion Record，这个记录类似于一份“执行报告”，告诉引擎语句执行的结果，以便决定下一步的动作。Completion Record 包含三个主要属性：</p>
<ol>
